            "def": " Fio de algodão, seda, etc.: novelo de linhas. Fio de metal, para as communicações telegráphicas. Cordão. Barbante, com um anzol na extremidade, para pescar peixe miúdo. Estrema, balisa, raia. Fileira: colloquem-se em linha. Categoria. A extensão, considerada com uma só dimensão ou comprimento. Traço: duas linhas parallelas. Lineamento. Cada um dos traços horizontaes de uma pauta de música. Trave horizontal, em que assentam as pernas da asna. Duodécima segunda parte de uma pollegada. Pequeno sinal gráphico, que se colloca á direita de uma letra, para a distinguir de outra, (em Álgebra). Serviço de transportes, entre dois pontos por determinada via: esta mercadoria veio pela linha do Sul. Direcção: seguiu em linha recta. Procedimento. Série de graus ou gerações de uma família. Estrada: linha férrea. "
